import './EventData.css'
import Form from './Form';
import { useState, useEffect } from 'react';
export default function EventData({searchString}) {

    const API_URL =
    "https://api.846policebrutality.com/api/incidents?&filter%5Bstate%5D=";
    const [link, setLink] = useState();

    const [results, setResults] = useState([]);
    const getData = async () => {
        // const {id} = props.match.params;
        try {
        const response = await fetch(API_URL + searchString);
        const data = await response.json();
        setResults(data.data);
        console.log(data.data)
        }catch(err){
            console.log(err);
        }
      };
    //   function handleSubmit(event){
    //     event.preventDefault();

    // }

      useEffect(() => {
        getData();
      }, [searchString]);
    return (
        <div>{    
           results.length &&

            results.map((ele, i) => {
                return (
              <div className="d3">
                  <p>{ele.title}</p>
                  <p>{ele.city}</p>
              <a href={`/details/${ele.id}`}key={i}>{ele.links}</a>
              <a href={ele.links} rel='noopener'>{ele.title}</a>

              </div>
        )})

}</div>)
}
